import jsPDF from 'jspdf';
import 'jspdf-autotable';

function modificarFecha(fechamod) {
  function mod(s) { return (s < 10) ? '0' + s : s; }
  return [
    mod(fechamod.getDate()),
    mod(fechamod.getMonth() + 1),
    fechamod.getFullYear()
  ].join('/');
}

export default function vhcPPDF(nombramiento, vehiculop, depreciacion, total) {
  let name = nombramiento.datos_empleado.pnombre;
  if (nombramiento.datos_empleado.snombre) {
    name += (" " + nombramiento.datos_empleado.snombre);
  }

  name += (" "+ nombramiento.datos_empleado.papellido);
  if (nombramiento.datos_empleado.sapellido) {
    name += (" " + nombramiento.datos_empleado.sapellido);
  }

  var doc = new jsPDF('p', 'pt');

  let imgData = 'data:image/jpeg;base64,' +
    '' +
    '';

  doc.setFont('courier');
  doc.setFontType('bold');
  doc.setFontSize('11');
  doc.addImage(imgData, 'JPEG', 30, 10, 50, 65);
  doc.text(190, 50, 'PLANILLA ADICIONAL DE VIÁTICO');

  doc.setFontType('normal');
  doc.setFontSize(8);
  doc.text(30, 85, 'Nombramiento o Acuerdo No.:');
  doc.line(220, 88, 400, 88)

  doc.setFontType('bold');
  doc.text(30, 100, 'DATOS DEL VEHICULO');
  doc.setFontType('normal');
  doc.setFontSize(7);
  doc.text(30, 115, 'PLACA:');
  doc.text(221, 115, vehiculop.vehiculo.placa);
  doc.line(220, 116, 400, 116);
  doc.text(30, 125, 'TIPO:');
  doc.line(220, 126, 400, 126);
  doc.text(221, 125, vehiculop.vehiculo.tipo);
  doc.text(30, 135, 'MARCA');
  doc.text(221, 135, vehiculop.vehiculo.marca);
  doc.line(220, 136, 400, 136);
  doc.text(30, 145, 'MOTOR');
  doc.text(221, 145, vehiculop.vehiculo.motor);
  doc.line(220, 146, 400, 146);
  doc.text(30, 155, 'MODELO');
  doc.text(221, 155, vehiculop.vehiculo.modelo);
  doc.line(220, 156, 400, 156);
  doc.text(30, 165, 'CHASIS');
  doc.text(221, 165, vehiculop.vehiculo.chasis);
  doc.line(220, 166, 400, 166);
  doc.text(30, 175, 'COMBUSTIBLE');
  doc.text(221, 175, vehiculop.vehiculo.combustible);
  doc.line(220, 176, 400, 176);
  doc.text(30, 185, 'USO');
  doc.text(221, 185, vehiculop.vehiculo.uso);
  doc.line(220, 186, 400, 186);
  doc.text(30, 195, 'COLOR');
  doc.text(221, 195, vehiculop.vehiculo.color);
  doc.line(220, 196, 400, 196);
  doc.text(30, 205, 'CILINDROS');
  doc.text(221, 205, vehiculop.vehiculo.cilindros);
  doc.line(220, 206, 400, 206);

  doc.setFontType('bold');
  doc.setFontSize(8);
  doc.text(30, 220, 'KILOMETRAJE RECORRIDO');

  // Tabla
  doc.setFontType('normal');
  doc.setFontSize(7);
  doc.rect(30, 226, 50, 10);
  doc.text(42, 233, 'Fecha');
  doc.rect(80, 226, 180, 10);
  doc.text(105, 233, 'Del municipio y departamento de');
  doc.rect(260, 226, 180, 10);
  doc.text(280, 233, 'Al municipio y departamento de');
  doc.rect(440, 226, 70, 10);
  doc.text(443, 233, 'Distancia en Km');

  let altura = 10;
  let iteracion = 1;
  let kilometros = 0;

  for(let obj of vehiculop.kilometraje) {
    let y = altura * iteracion
    doc.rect(30, 226 + y, 50, 10);
    doc.text(32, 233 + y, modificarFecha(obj.fecha));
    doc.rect(80, 226 + y, 180, 10);
    doc.text(82, 233 + y,
      `${obj.lugarSalida.municipio}, ${obj.lugarSalida.departamento}`);
    doc.rect(260, 226 + y, 180, 10);
    doc.text(262, 233 + y,
      `${obj.lugarLlegada.municipio}, ${obj.lugarLlegada.departamento}`);
    doc.rect(440, 226 + y, 70, 10);
    doc.text(443, 233 + y, obj.distancia);

    kilometros += +obj.distancia;

    if(iteracion === vehiculop.kilometraje.length) {
      doc.setFontType('bold');
      doc.text(32, 245 + y,`Total Km recorridos: ${kilometros}`);
    }

    iteracion++;
  }

  doc.setFontSize(8);
  doc.text(30, 370, 'FACTURAS PRESENTADAS');
  doc.setFontType('normal');

  // Tabla
  doc.setFontSize(7);
  doc.rect(30, 375, 50, 17);
  doc.text(37, 382, 'Fecha de \nFactura');
  doc.rect(80, 375, 50, 17);
  doc.text(86, 382, 'Numero de \n Factura');
  doc.rect(130, 375, 50, 17);
  doc.text(140, 385, 'Galones');
  doc.rect(180, 375, 245, 17);
  doc.text(275, 385, 'Proveedor')
  doc.rect(425, 375, 85, 17);
  doc.text(427, 385, 'Valor de la Factura');

  let facturas = 0;
  iteracion = 0;

  for(let obj of vehiculop.facturas) {
    let y = altura * iteracion;
    doc.rect(30, 392 + y, 50, 10);
    doc.text(32, 399 + y, modificarFecha(obj.fecha));
    doc.rect(80, 392 + y, 50, 10);
    doc.text(82, 399 + y, obj.numero);
    doc.rect(130, 392 + y, 50, 10);
    doc.text(132, 399 + y, obj.galones);
    doc.rect(180, 392 + y, 245, 10);
    doc.text(182, 399 + y, obj.proveedor)
    doc.rect(425, 392 + y, 85, 10);
    doc.text(427, 399 + y, obj.valor);

    facturas += +obj.valor;

    if(iteracion === (vehiculop.facturas.length - 1)) {
      doc.setFontType('bold');
      doc.text(32, 412 + y,`Total valor de Facturas: Q${facturas}`);
    }

    iteracion++;
  }

  doc.setFontSize(8);
  doc.text(30, 570, 'DEPRECIACION');
  doc.setFontType('normal');

  // Tabla
  doc.setFontSize(7);
  doc.rect(30, 575, 170, 10);
  doc.text(32, 583, 'Total de kilómetros recorridos');
  doc.rect(200, 575, 170, 10);
  doc.text(202, 583, 'Q1.00 por kilómetro recorrido');
  doc.rect(370, 575, 170, 10);
  doc.text(372, 583, 'TOTAL');

  let totalDepreciacion = kilometros * depreciacion;

  doc.rect(30, 585, 170, 10);
  doc.text(32, 593, `${kilometros}`);
  doc.rect(200, 585, 170, 10);
  doc.text(202, 593, `${depreciacion}`);
  doc.rect(370, 585, 170, 10);
  doc.text(372, 593, `${totalDepreciacion}`);

  // footer
  doc.setFontSize(9);
  doc.text(30, 620, `TOTAL Q${total}`);

  doc.setFontSize(8);
  doc.setFontType('normal');
  doc.text(30, 650, 'Observaciones:');
  let observaciones = '';
  if(vehiculop.observaciones) {
    observaciones = doc.splitTextToSize(vehiculop.observaciones, 515);
  }
  doc.setFontSize(7);
  doc.text(30, 658, observaciones);

  doc.text(210, 690, '(f)');
  doc.line(210, 695, 360, 695);
  doc.text(210, 705, `Nombre completo: ${name}`);
  doc.text(210, 715, `Cargo: ${nombramiento.datos_empleado.cargo}`);

  doc.text(30, 750, 'Vo. Bo.(f)');
  doc.line(30, 755, 200, 755);
  doc.text(30, 765, `Nombre completo: ${nombramiento.datos_dependencia.encargado}`);
  doc.text(30, 775, `Cargo: ${nombramiento.datos_dependencia.cargoEn}`);

  doc.save('planilla_vehiculop.pdf');
}
